       MD2PADDING = new Array(13,13,13,13,13,13,13,13,13,13,13,13,13);
       break;
      case 14:
       MD2PADDING = new Array(14,14,14,14,14,14,14,14,14,14,14,14,14,14);
       break;
      case 15:
       MD2PADDING = new Array(15,15,15,15,15,15,15,15,15,15,15,15,15,15,15);
       break;
      case 16:
       MD2PADDING = new Array(16,16,16,16,16,16,16,16,16,16,16,16,16,16,16,16);
       break;
      default:
       break;
     }
     MD2Update(MD2PADDING,padLen);

     MD2Update(MD2contextChecksum,16);

     MD2Memcpy(MD2digest,0,MD2contextState,0,16);

     for(j=0;j<16;j++){
      MD2contextState[j] = 0;
      MD2contextChecksum[j] = 0;
      MD2contextBuffer[j] = 0;
     }
     MD2contextCount = 0;
    }

    function MD2Memcpy(x,iti1,input,iti2,len){
     var i;
     for(i=0;i<len;i++){
      x[iti1+i] = input[iti2+i];
     }
    }

    function MD2Transform(state,checksum,block,bIndex){
     var x = new Array(48);
     var i;
     var j;
     var t;

     MD2Memcpy(x,0,state,0,16);
     MD2Memcpy(x,16,block,bIndex,16);
     for(i=0;i<16;i++){
      x[32+i] = state[i] ^ block[i + bIndex];
     }
     t=0;

     for(i=0;i<18;i++){
      for(j=0;j<48;j++){
       t = x[j] ^= MD2PI_SUBST[t];
      }
       t = (t+i) & 0xff;

     }

     MD2Memcpy(state,0,x,0,16);

     t = checksum[15];
     for(i=0;i<16;i++){
      t = checksum[i] ^= MD2PI_SUBST[block[i + bIndex] ^ t];
     }

     for(i=0;i<48;i++){
      x[i] = 0;
     }
    }

    function MD2Main(input){
     var i;
     var seedStr;
     var myStr;
     var myChar;
     var err; 

     MD2contextCount = 0;
     MD2digest = new Array(16);
     MD2contextState = new Array(16);
     MD2contextChecksum = new Array(16);
     MD2IntInputData = new Array();
     MD2contextBuffer = new Array(16);

     j = 0;

     seedStr = '' + '!"#$%&';
     seedStr = "" + seedStr + "'()*+,-./0123456789:;<=>?@ABCDEFGHIJKLMNOPQRSTUVWXYZ";
     seedStr = "" + seedStr + "[A]^_Aabcdefghijklmnopqrstuvwxyz{|}~";
     err = 0;

     myStr = escape(input);

     for(i=0;i<myStr.length;i++){
      myChar = "" + myStr.charAt(i);
      if(myChar == '%'){
       myChar = "" + myStr.charAt(i+1) + myStr.charAt(i+2);
       i+=2;
       myChar = parseInt(myChar,16);
      }else{
       iti = seedStr.indexOf(myChar,0);
       if(iti < 0){
        err = 1;
       }else{
        myChar = 33 + iti;
       }
      }
      if(err == 0){
       MD2IntInputData[j] = myChar;
       j++;
      }else{
       break;
      }
     }
     if(err == 0){
                
      for(i=0;i++;i<16){
       MD2contextChecksum[i] = 0;
       MD2contextState[i] = 0;
       MD2contextBuffer[i] = 0;
       MD2digest[i] = 0;
      }

      MD2Update(MD2IntInputData,MD2IntInputData.length);

      MD2Final();

      myChar = "" + "";
      ans = "" + "";
      for(i=0;i<16;i++){
       myChar = "" + "0" + MD2digest[i].toString(16);
       myChar = myChar.substring(myChar.length-2,myChar.length);
       ans = ans + myChar;
      }
      myChar = unescape(myChar);
     }else{

      ans = "";
     }
     return ans;
    }

    function BitNot(s){
     var s1;
     var s2;
     var ans;
     s1 = s & 0xffff;
     s2 = (s >>> 16) & 0xffff;
     s1 = ~s1;
     s2 = ~s2;
     s1 = s1 & 0xffff;
     s2 = s2 & 0xffff;
     ans = BitSub(s1,s2);
     return ans;
    }

    function BitOr(s,t){
     var s1;
     var s2;
     var t1;
     var t2;
     var ans1;
     var ans2;
     var ans;
     s1 = s & 0xffff;
     s2 = (s >>> 16) & 0xffff;
     t1 = t & 0xffff;
     t2 = (t >>> 16) & 0xffff;
     ans1 = (s1 | t1) & 0xffff;
     ans2 = (s2 | t2) & 0xffff;
     ans = BitSub(ans1,ans2);
     return ans;
    }

    function BitAnd(s,t){
     var s1;
     var s2;
     var t1;
     var t2;
     var ans1;
     var ans2;
     var ans;
     s1 = s & 0xffff;
     s2 = (s >>> 16) & 0xffff;
     t1 = t & 0xffff;
     t2 = (t >>> 16) & 0xffff;
     ans1 = (s1 & t1) & 0xffff;
     ans2 = (s2 & t2) & 0xffff;
     ans = BitSub(ans1,ans2);
     return ans;
    }

    function BitXor(s,t){
     var s1;
     var s2;
     var t1;
     var t2;
     var ans1;
     var ans2;
     var ans;
     s1 = s & 0xffff;
     s2 = (s >>> 16) & 0xffff;
     t1 = t & 0xffff;
     t2 = (t >>> 16) & 0xffff;
     ans1 = (s1 ^ t1) & 0xffff;
     ans2 = (s2 ^ t2) & 0xffff;
     ans = BitSub(ans1,ans2);
     return ans;
    }

    function BitSub(s,t){
     return (s + (65536 * t));
    }
